import React, { useState } from "react";
import { Link } from "react-router-dom";

export default function Aside() {
  const [isOpen, setIsOpen] = useState(true);
  // const toggle = () => setIsOpen(!isOpen);
  const toggle = () => {
    setFlag(!flag);
    setIsOpen(!isOpen);
  };
  const [myStyle, setMyStyle] = useState({
    color: "white",
    backgroundColor: "black",
  });
  const [darkMode, setDarkMode] = useState(false);
  const toggleStyle = () => {
    if (myStyle.color == "white") {
      setMyStyle({
        color: "black",
        backgroundColor: "white",
      });
    } else {
      setMyStyle({
        color: "white",
        backgroundColor: "black",
      });
    }
  };
  const [open1, setOpen1] = useState(false);
  const [open2, setOpen2] = useState(false);
  const [open3, setOpen3] = useState(false);
  const [open4, setOpen4] = useState(false);
  const [flag, setFlag] = useState(false);
  const active2 = {
    color: "red !important",
  };
  const tagg1 = {
    display: "block",
    height: "auto",
  };

  // let user = [(newlink = "/launchpad")];
  return (
    <div>
      <div className={flag ? "main" : null}>
        <nav
          className="slider"
          style={{
            width: isOpen ? "270px" : "80px",
          }}
        >
          <header>
            <Link to="/LaunchpadPool/pools/Live">
              <div className="group_all">
                <div className="image-text">
                  <span className="image">
                    <img src="/images/newlogo.png" alt="" />
                  </span>

                  <div
                    className="text header-text"
                    style={{ display: isOpen ? "block" : "none" }}
                  >
                    <img src="/images/newlogo_2.png" className="name" alt="" />
                    {/* --> */}
                  </div>
                </div>
              </div>
            </Link>

            <span
              onClick={toggle}
              className="arrow_close"
              style={{ marginLeft: isOpen ? "25%" : "0%" }}
            >
              {/* className="toggle" */}
              <img src="/images/newarrow-left.png" alt="" srcset="" />
            </span>
            <span
              onClick={toggle}
              className="arrow_close1"
